import { useEffect, useState } from "react";
import "../App.css";
import Message from '../Components/Message';
import Sender from '../Components/Sender';
import { Route, Routes } from 'react-router-dom';



import { createClient } from '@supabase/supabase-js';
const supabaseUrl = "https://jftaxymlbutkjoacvtbk.supabase.co";
const supabaseKey = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImpmdGF4eW1sYnV0a2pvYWN2dGJrIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MTM5NjkxOTMsImV4cCI6MjAyOTU0NTE5M30.2aT1UzmiN34aKLNRUXAKwhKfnuwxMoiM3eMkHs1oyZU";
const supabase = createClient(supabaseUrl, supabaseKey);

function Running() {

    const colors = [
        "red",
        "blue",
        "green",
        "yellow",
        "purple"
    ];
    const spheres = [];
    for (let i = 0; i < 5; i++) {
        const color = colors[Math.floor(Math.random() * colors.length)];
        const x = Math.random() * window.innerWidth;
        const y = Math.random() * window.innerHeight;
        const blur = Math.random() * 10 + 5;
        const zIndex = Math.random() * 10;
        spheres.push(
            <div key={i} style={{
                position: "absolute",
                backgroundColor: color,
                height: "200px",
                width: "200px",
                borderRadius: "50%",
                left: x + "px",
                top: y + "px",
                filter: "blur(" + blur + "px)",
                zIndex: zIndex,
            }} />
        );
    }

    return (
        <>
            <div style={{
                padding: "40px",
                alignItems: "center",
                justifyContent: "center",
                backgroundColor: "#1f1f1f",
                height: "100vh",
                color: "white",
                overflow: "hidden",
                position: "relative",
            }}>
                <h1>You don't need your phone right now</h1>

                {spheres}
            </div>
        </>
    );
}
export default Running;
